import React from "react";
import { NavLink } from "react-router-dom";

function NavMain() {
  return (
    <div>
      <nav className='navMain'>
        <div>
          <h1 className='navMain-title'><a>DINO DISCORD</a></h1>
        </div>
        <div className='navMain-choices'>
          <p className='nav-item'>profil</p>
          <p className='nav-item'>login</p>
          <p className='nav-item'>logout</p>
        </div>
      </nav>
    </div>
  )

}

export default NavMain;
